import React from "react";
import { Footer, FooterTab, Button, Text } from "native-base";
import { NativeRouter, Route, Link } from "react-router-native";
import { StarScreen } from "./star/Star";

export const AppFooter = ({ match }) => (
  <NativeRouter>
    <Footer>
      <FooterTab>
        <Button active>
          <Text>All Cities</Text>
        </Button>
        <Button>
          <Text>My City</Text>
        </Button>
        <Link to={`${match.url}/starScreen`} underlayColor="#f0f4f7">
          <Text>Star</Text>
        </Link>
      </FooterTab>
    </Footer>

    <Route exact path="/" component={App} />
    <Route path="/starScreen" component={StarScreen} />
  </NativeRouter>
);
